As I dive deeper into reflection of this past year I can’t help but be overjoyed and so incredibly proud of myself. 

A major goal of mine was to find my way back home to self. As someone who consistently watched makeup videos for over decade, I was so fearful of taking the leap and immersing myself in the love I had for the world of beauty. I was terrified of how I’d be perceived, judgment, not being good at enough at makeup, etc… 

Looking at myself now, experimenting, having fun, trying new looks, and finally seeing what was always on the inside on the surface for the world to see - I am beyond emotional and again, so damn proud. 

A true testament of what it means to love yourself. 

Thank you to those who’ve shared words of encouragement and to my therapist for continually bringing me back to the conversation/question of, “What does it mean to take up space?” 

Let this be a message to those who are fearful of expressing themselves authentically in color, questioning queer identity, balancing the duality of masculine and feminine energy, and hesitant to take up space. The first step is always the most frightening. However, the inner work is most certainly worth it. 

This platform, this community we are creating - you are safe here. I see you and I love you. 

